define({"topics" : [{"title":"Save function (Interface Viewer)","shortdesc":"\n                     <p class=\"shortdesc\">Once the proper controls have been named in the tree, and the identifying       properties have been selected, you can save\n                        the definitions to the interface entity with the         <span class=\"ph uicontrol\">Save</span>       <img class=\"image\" src=\"TA_Help\/Topics\/TA_Help\/Images\/btn_Interface_Viewer-Save.png\"></img> button.\n                     </p>\n                  ","id":"Interface_viewer_other_functionality_save","href":"TA_Help\/Topics\/Interface_def_Viewer_save.html","menu": {"hasChildren":false,},"tocID":"Interface_viewer_other_functionality_save-d46e22900","topics":[]},{"title":"Refresh function (Interface Viewer)","shortdesc":"\n                     <p class=\"shortdesc\">Click the Viewer&apos;s <span class=\"ph uicontrol\">Refresh</span> button to prompt it to re-inventory     all the currently open windows in the system.\n                     </p>\n                  ","id":"Interface_viewer_refresh","href":"TA_Help\/Topics\/Interface_def_Viewer_refresh.html","menu": {"hasChildren":false,},"tocID":"Interface_viewer_refresh-d46e22916","topics":[]},{"title":"Handling of non-active open interface entities","shortdesc":"\n                     <p class=\"shortdesc\">The <span class=\"keyword wintitle\">Interface Viewer</span> generally only works with an interface entity in the active tab.     Under some circumstances, it makes exceptions.\n                     </p>\n                  ","id":"Interface_viewer_open_on_top","href":"TA_Help\/Topics\/Interface_def_Viewer_open_on_top.html","menu": {"hasChildren":false,},"tocID":"Interface_viewer_open_on_top-d46e22930","topics":[]},{"title":"HTML tags filter (Interface Viewer)","shortdesc":"\n                     <p class=\"shortdesc\">Web pages are composed of HTML elements rather than controls, with each element type   specified by a tag. Web applications\n                        can often have pages with a large number of tags that you   really have no need to interface with for proper testing. The\n                        Interface Viewer helps you by   allowing you to limit the elements displayed in the <span class=\"keyword wintitle\">UI explorer</span> to only   certain types, excluding all others.\n                     </p>\n                  ","id":"Interface_viewer_other_functionality_html_tag_filter","href":"TA_Help\/Topics\/Interface_def_Viewer_HTML_tag_filter.html","menu": {"hasChildren":false,},"tocID":"Interface_viewer_other_functionality_html_tag_filter-d46e22944","topics":[]},{"title":"Copy value","shortdesc":"\n                     <p class=\"shortdesc\">The             <span class=\"keyword wintitle\">Properties Panel</span> displays the current property-value pairs of the         selected control.\n                     </p>\n                  ","id":"Interface_viewer_copy_value","href":"TA_Help\/Topics\/Interface_def_Viewer_Copy_value.html","menu": {"hasChildren":false,},"tocID":"Interface_viewer_copy_value-d46e22958","topics":[]},{"title":"Show invisible windows","shortdesc":"\n                     <p class=\"shortdesc\">Getting the <span class=\"keyword wintitle\">Interface Viewer</span>&apos;s <span class=\"keyword wintitle\">UI Explorer</span> to display invisible         windows.\n                     </p>\n                  ","id":"task_o1p_nkd_rl","href":"TA_Help\/Topics\/Interface_def_Viewer_show_invisible_windows.html","menu": {"hasChildren":false,},"tocID":"task_o1p_nkd_rl-d46e22974","topics":[]},{"title":"Show invisible controls","shortdesc":"\n                     <p class=\"shortdesc\">Getting the <span class=\"keyword wintitle\">Interface Viewer</span>&apos;s <span class=\"keyword wintitle\">UI Explorer</span> to display invisible         controls.\n                     </p>\n                  ","id":"task_wxx_2ld_rl","href":"TA_Help\/Topics\/Interface_def_Viewer_show_invisible_controls.html","menu": {"hasChildren":false,},"tocID":"task_wxx_2ld_rl-d46e22993","topics":[]},{"title":"Show all processes","shortdesc":"\n                     <p class=\"shortdesc\">By     default, this toggle item on the <span class=\"ph uicontrol\">View</span> menu is enabled, which results in a     display of all visible windows.\n                     </p>\n                  ","id":"Interface_viewer_show_all_processes","href":"TA_Help\/Topics\/Interface_def_Viewer_show_all_proccesses.html","menu": {"hasChildren":false,},"tocID":"Interface_viewer_show_all_processes-d46e23010","topics":[]},{"title":"Using Microsoft UI Automation Technology ","shortdesc":"\n                     <p class=\"shortdesc\">The purpose of UI Automation technology is to expose rich information about the UI   elements used in Windows applications.</p>\n                  ","id":"concept_e2h_5hz_pn","href":"TA_Help\/Topics\/ug_Interface_def_Viewer_UIA.html","menu": {"hasChildren":false,},"tocID":"concept_e2h_5hz_pn-d46e23025","topics":[]},{"title":"Capture all controls","shortdesc":"\n                     <p class=\"shortdesc\">To hasten the process of capturing all available controls belonging to a specific TA         class, you can use the <span class=\"ph uicontrol\">Capture all controls</span> function in the             <span class=\"keyword wintitle\">Interface Viewer</span>.\n                     </p>\n                  ","id":"task_a4q_5cc_ht","href":"TA_Help\/Topics\/ug_Interface_def_Viewer_capture_all_controls.html","menu": {"hasChildren":false,},"tocID":"task_a4q_5cc_ht-d46e23036","topics":[]},{"title":"Text recognition (Interface Viewer)","shortdesc":"\n                     <p class=\"shortdesc\">The <dfn class=\"term\">Text Recognition</dfn> feature in the Interface Viewer helps you determine         which drawing Windows APIs should be employed. The employed APIs\n                        will help the Graphics         Device Interface (GDI) built-in actions detect text produced by the AUT. \n                     </p>\n                  ","id":"task_u3p_ghk_qx","href":"TA_Help\/Topics\/ug_Interface_viewer_text_recognition.html","menu": {"hasChildren":false,},"tocID":"task_u3p_ghk_qx-d46e23054","topics":[]}]});